import { makeStyles } from '@material-ui/core/styles';

const useStyles = makeStyles((theme) => ({
    name: {
        color: '#FF6C00',
        fontFamily: 'liebedoni-solid',
        padding: '0.5rem calc((100vw - 910px) / 2)',
        marginLeft: '20px',
        fontSize: 60,
        marginBottom: 0,
        marginTop: 90,
    },
    info: {
        color: '#000',
        padding: '0.5rem calc((100vw - 910px) / 2)',
        fontSize: 28,
        marginLeft: '20px',
        marginBottom: 90,
    },
    }));

export default useStyles;
